// import react
import React from 'react'

// import router from dom -> lembrar que o switch foi desusado.
import {
    Switch,
    Route
} from 'react-router-dom'

// import style
import './Content.css'

// import componentes
import Home from '../../views/examples/Home'

const Content = props => (
    <main className='Content'>
        <Switch>
            <Route exact path="/">
                <Home />
            </Route>
            <Route path="/useState">
                <UseState />
            </Route>
        </Switch>
    </main>
)


export default Content
